import React from 'react'
import ListItem from './ListItem'
import { User } from '../interfaces'

type Props = {
    items: User[]
}

const List: React.FunctionComponent<Props> = ({ items }) => (
    <ul>
        {items.map((item) => (
            <li key={item.id}>
                <ListItem data={item}/>
            </li>
        ))}
    </ul>
)

export default List
